import React from "react";

export function WordDisplay(props) {
  return (
    <div className="list">
      <h2>Current List Words</h2>
      <p>Tiger</p>
      <p>Direction</p>
      <p>Absorb</p>
      <p>Creation</p>
    </div>
  );
}
